import React from "react";
import "../HojasDeEstilo/SobreMi.css"

function SobreMi (){
  return(
    <section className="container text-center text-white about-me">
    <div>
      <h1 id="About-me">About me</h1>
      <h3 className="about-me-h3">Estudiante de la carrea de Ingenieria de Sistemas de la Universidad Autonoma Tomas Frias realizando proyectos para la culminacion de mi carrera</h3>
    </div>
  </section>
  )
}

export default SobreMi
